INSERT INTO `c_course_description` (`iid`, `id`, `c_id`, `title`, `content`, `session_id`, `description_type`, `progress`) VALUES
(1, 1, 2, 'DESCRIPCION', '<p>La metodolog&iacute;a de trabajo en el &aacute;rea de Tecnolog&iacute;a e Inform&aacute;tica para el grado sexto de b&aacute;sica secundaria es de car&aacute;cter&nbsp;<strong>te&oacute;rico-pr&aacute;ctica</strong>, utilizando como medio tangible el computador, siendo este &uacute;ltimo componente en el que m&aacute;s se hace &eacute;nfasis debido a la aplicaci&oacute;n pr&aacute;ctica que tienen las tem&aacute;ticas planteadas para el &aacute;rea, como una base para apoyar las dem&aacute;s &aacute;reas del conocimiento como eje transversalizador.</p>\r\n', 0, 1, 0),
(2, 2, 2, 'OBJETIVOS ESPECÍFICOS ', '<ol>\r\n	<li data-priority=\"\">Mostrarle al alumno la importancia, que representa la Tecnolog&iacute;a, la Ciencia y la T&eacute;cnica en nuestras vidas.</li>\r\n	<li data-priority=\"\">Crear una cultura en el alumno, a cerca de la importancia de la inform&aacute;tica, como una tecnolog&iacute;a de punta, e indispensable hoy en d&iacute;a.</li>\r\n	<li data-priority=\"\">Generar espacios de trabajo investigativo, que le permitan sacar conjeturas del impacto que tiene la ciencia y la tecnolog&iacute;a, en la vida cotidiana.</li>\r\n</ol>\r\n', 0, 2, 0),
(3, 3, 2, 'Contenidos', '<p>Origen y servicios del internet. Origen y evoluci&oacute;n de los artefactos tecnol&oacute;gicos. Tecnolog&iacute;a y t&eacute;cnica. Tecnolog&iacute;a y ciencia. Introducci&oacute;n a las hojas de c&aacute;lculo. Aplica los&nbsp;<strong>conocimientos</strong>&nbsp;de la tecnolog&iacute;a y la evoluci&oacute;n de los artefactos tecnol&oacute;gicos.</p>\r\n', 0, 3, 0),
(4, 4, 2, 'Metodología', '<p><strong>Resolver problemas</strong>&nbsp;aplicando las nociones fundamentales de la inform&aacute;tica Describir un problema identificar los detalles importantes necesarios para resolver un problema, Descomponer el problema en peque&ntilde;os y l&oacute;gicos pasos, Utilizar pasos para crear un proceso secuencial y ordenado (algoritmo) que resuelva un problema Evaluar el proceso desarrollado en la soluci&oacute;n de un problema</p>\r\n', 0, 4, 0),
(5, 5, 2, 'MATERIALES DE TRABAJO:', '<p>Dispositivo:</p>\r\n\r\n<p>1. Computador personal</p>\r\n\r\n<p>2. Celular</p>\r\n\r\n<p>3. Internet</p>\r\n', 0, 5, 0),
(6, 6, 6, 'Informática', '<p>El curso &quot;Fundamentos de Programaci&oacute;n Web&quot; de la asignatura Informatica,&nbsp;tiene como objetivo brindar a los estudiantes los conocimientos fundamentales en programaci&oacute;n web, espec&iacute;ficamente en HTML, CSS y JavaScript. Durante el curso, los estudiantes aprender&aacute;n a crear, estructurar y dar formato a p&aacute;ginas web, as&iacute; como agregar interactividad y funcionalidad utilizando JavaScript.</p>\r\n\r\n<p>El curso se divide en cuatro unidades, cada una abordando temas espec&iacute;ficos para lograr los objetivos propuestos. La primera unidad se enfoca en la creaci&oacute;n de un sitio web b&aacute;sico utilizando HTML y CSS. Los estudiantes aprender&aacute;n las etiquetas y atributos necesarios para crear una p&aacute;gina web adecuada, as&iacute; como las reglas de estilo para darle formato y dise&ntilde;o.</p>\r\n\r\n<p>La segunda unidad se centra en el correcto uso de etiquetas y atributos HTML para estructurar y dar formato a una p&aacute;gina web. Se ense&ntilde;ar&aacute;n las etiquetas m&aacute;s comunes y las reglas de estilo CSS para lograr un dise&ntilde;o adecuado.</p>\r\n\r\n<p>En la tercera unidad, los estudiantes aprender&aacute;n a incorporar im&aacute;genes, enlaces y videos en una p&aacute;gina web utilizando HTML y CSS. Se les ense&ntilde;ar&aacute; c&oacute;mo estructurar correctamente estos elementos y darles formato adecuado.</p>\r\n\r\n<p>Finalmente, la cuarta unidad se enfoca en los fundamentos de programaci&oacute;n web utilizando JavaScript. Se explorar&aacute;n conceptos como variables, funciones, estructuras de control y eventos. Adem&aacute;s, se abordar&aacute; la integraci&oacute;n de JavaScript con HTML y CSS para agregar interactividad y funcionalidad a una p&aacute;gina web.</p>\r\n', 0, 1, 0),
(7, 7, 6, 'Objetivos', '<p>Dar a conocer conceptos b&aacute;sicos de creaci&oacute;n de p&aacute;ginas web, de forma que el estudiante pueda ir involucr&aacute;ndose en procesos de desarrollo web</p>\r\n\r\n<p><u><strong>Objetivos espec&iacute;ficos:</strong></u></p>\r\n\r\n<p>&bull; Aprender las caracter&iacute;sticas de una p&aacute;gina web</p>\r\n\r\n<p>&bull; Aprender los componentes b&aacute;sicos para el desarrollo de una p&aacute;gina web</p>\r\n\r\n<p>&bull; Aprender c&oacute;mo desarrollar una p&aacute;gina web que se adapte a diferentes dispositivos</p>\r\n', 0, 2, 0),
(8, 8, 6, 'Contenidos', '<p><span style=\"font-size:16px;\"><strong>&nbsp; &nbsp; <u>&nbsp;Periodo I</u></strong></span></p>\r\n\r\n<p><span style=\"font-size: 16px;\"><b>&nbsp; &nbsp; &nbsp;Las partes del teclado</b></span></p>\r\n\r\n<p><span style=\"font-size: 16px;\"><b>&nbsp; &nbsp; &nbsp;El codigo ASCii</b></span></p>\r\n\r\n<p style=\"margin-left:15.0pt\"><b><span lang=\"ES\" style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">desarrollo web intermedio</span></span></b></p>\r\n\r\n<p style=\"margin-left:15.0pt\">&nbsp;</p>\r\n', 0, 3, 0),
(9, 9, 6, 'Metodología', '<p>El curso consiste en sesiones te&oacute;rico/pr&aacute;cticas en el aula, a la vez se propondr&aacute;n ejercicios que refuercen los conocimientos adquiridos. De este modo, el estudiante aprende con la pr&aacute;ctica, a trav&eacute;s de la realizaci&oacute;n de ejercicios espec&iacute;ficos Durante la clase el estudiante deber&aacute; estar atento a los temas que se expongan y resolver los ejercicios que se planteen, adem&aacute;s de participar activamente. Se abordar&aacute;n clases magistrales como introducci&oacute;n a las actividades que se desarrollan en cada sesi&oacute;n.</p>\r\n', 0, 4, 0),
(10, 10, 6, 'Materiales', '<p>Acceso a computadora,&nbsp;celular o dispositivo movil, para realizar casos de estudio o posibles proyectos en casa.</p>\r\n', 0, 5, 0),
(11, 11, 6, 'Habilidades a obtener', '<p>Utilizaci&oacute;n de HTML</p>\r\n\r\n<p>Utilizaci&oacute;n de componentes de Boostrap</p>\r\n\r\n<p>Utilizaci&oacute;n de selectores CSS</p>\r\n\r\n<p>Creaci&oacute;n de una pagina web basica</p>\r\n', 0, 6, 0),
(12, 12, 6, 'Evaluación', '<p>Los estudiantes seran evaluados a travez de las siguientes activgidades:</p>\r\n\r\n<p>1. Presentacion de una pagina web basica</p>\r\n\r\n<p>2. Entrega de un men&uacute; de navegaci&oacute;n funcional&nbsp;</p>\r\n\r\n<p>3. Entrega de un formulario de contacto</p>\r\n\r\n<p>4. Presentacion de un albun de fotos utilizando HTML y CSS</p>\r\n', 0, 7, 0),
(13, 13, 6, 'Webgrafia', '<p>&nbsp;</p>\r\n\r\n<p><a href=\"https://edtk.co/plan/809\">Fundamentos de programaci&oacute;n web (edtk.co)</a></p>\r\n\r\n<p><a href=\"https://yadiralexanderagudelodurango.jimdofree.com/tecnologia-e-informatica-grado-10/\">TECNOLOGIA E INFORMATICA GRADO 10&ordm; - P&aacute;gina Jimdo de yadiralexanderagudelodurango (jimdofree.com)</a></p>\r\n\r\n<p><a href=\"https://www.colombiaaprende.edu.co/contenidos/coleccion/orientaciones-curriculares-de-tecnologia-e-informatica\">Orientaciones Curriculares de Tecnolog&iacute;a e Inform&aacute;tica | Colombia Aprende</a></p>\r\n\r\n<p><a href=\"https://www.colombiaaprende.edu.co/sites/default/files/files_public/2022-11/Orientaciones_Curricures_Tecnologia.pdf\">Orientaciones_Curricures_Tecnologia.pdf (colombiaaprende.edu.co)</a></p>\r\n\r\n<p>&nbsp;</p>\r\n', 0, 8, 0);
