INSERT INTO `c_glossary` (`iid`, `c_id`, `glossary_id`, `name`, `description`, `display_order`, `session_id`) VALUES
(1, 19, 1, 'FORMA Y TAMAÑO DE LA CELULA', '', 1, 0),
(2, 6, 2, 'Seudocódigo', '<p>La siguiente definici&oacute;n nos permite comprender qu&eacute; es un pseudoc&oacute;digo, una noci&oacute;n que<br />\r\nse emplea en el &aacute;mbito de la inform&aacute;tica. Se trata de un falso lenguaje, ya que apela a las<br />\r\nnormas de estructura de un lenguaje de programaci&oacute;n, aunque se encuentra desarrollado<br />\r\npara que pueda ser le&iacute;do por un ser humano y no interpretado por una m&aacute;quina.<br />\r\nEl pseudoc&oacute;digo, en este sentido, est&aacute; considerado como una descripci&oacute;n de un algoritmo<br />\r\nque resulta independiente de otros lenguajes de programaci&oacute;n. Para que una persona<br />\r\npueda leer e interpretar el c&oacute;digo en cuesti&oacute;n, se excluyen diversos datos que no son clave<br />\r\npara su entendimiento.</p>\r\n', 1, 0);
